import Header from "../../components/header/Header";
import "./home.scss";
const Home = () => {
  return (
    <div className="container">
      <Header />
      <body>
        <div className="main">
            <h1 className="title-main">Filmes, series e muito mais, sem limites</h1>
        </div>
      </body>
    </div>
  );
};

export default Home;
